import React from "react";
import styled from "styled-components";

const Chart = styled.svg`
  width: 40%;
  float: right;
  margin: auto;
  z-index: -1;
`;

const ChartDesc = styled.div`
  position: absolute;
  text-align: center;
  left: 50%;
  top: 50%;
  transform: translate(-50%, -50%);
`;

export default function ContributionChart(props) {
  return (
    <>
      <Chart className="techHolder__chart" viewBox="0 0 36 36">
        <path
          d="M18 2.0845
                    a 15.9155 15.9155 0 0 1 0 31.831
                    a 15.9155 15.9155 0 0 1 0 -31.831"
          fill="none"
          stroke="#444"
          strokeWidth="1"
        />
      </Chart>
      <ChartDesc className="techHolder__desc">
        MY JOB<br></br>
        뭐시기<br></br>
        뭐시기<br></br>
        뭐시기<br></br>
        <br></br>
        WITH TEAM<br></br>
        저시기
      </ChartDesc>
    </>
  );
}
